import { CoursePart } from "../types";
//import { NormalPart, ProjectPart, SubmissionPart } from './Parts'

const Content = (props: ContentProps) => {


  props.courseParts.map((part: CoursePart) => {
    switch (part.type) {
      case 'normal':
        return (
        <div>
          <p>{part.name} <b>{part.exerciseCount}</b><br/>{part.description}</p>
        </div>
      );
      case 'groupProject':
        return (
        <div>
          <p>{part.name} <b>{part.exerciseCount}</b><br/>Project members: {part.groupProjectCount}</p>
        </div>
      );
      case 'submission':
        return (<div>
          <p>{part.name} <b>{part.exerciseCount}</b><br/>{part.description}<br/>{part.exerciseSubmissionLink}</p>
        </div>
      );
    }
  })


}
interface ContentProps {
    courseParts: Array<CoursePart>;
}

export default Content;


